import React, { useState } from "react";
import { Link } from "react-router-dom";

function Register() {
  const [agreed, setAgreed] = useState(false);

  return (
    <div style={{
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      minHeight: "100vh",
      backgroundColor: "white",
      fontFamily: "Arial, sans-serif",
      padding: "1rem",
      position: "relative"
    }}>

      {/* Top-right links */}
      <div style={{
        position: "absolute",
        top: "2rem",
        right: "2rem",
        display: "flex",
        gap: "1rem",
        fontWeight: "bold"
      }}>
        <Link to="/" style={{ cursor: "pointer", color: "black", textDecoration: "none" }}>Home</Link>
        <Link to="/categories" style={{ cursor: "pointer", color: "black", textDecoration: "none" }}>Categories</Link>
        <Link to="/checkout" style={{ cursor: "pointer", color: "black", textDecoration: "none" }}>Checkout</Link>
      </div>

      <div style={{ width: "100%", maxWidth: "400px" }}>
        {/* Title */}
        <h2 style={{ fontSize: "2rem", fontWeight: "bold", color: "black", textAlign: "left", marginBottom: "1rem" }}>
          Register
        </h2>

        {/* Name */}
        <div style={{ marginBottom: "1rem" }}>
          <label style={{ display: "block", marginBottom: "0.3rem", fontSize: "0.9rem" }}>Name</label>
          <input
            type="text"
            placeholder=""
            style={{ width: "100%", padding: "0.8rem", borderRadius: "6px", border: "1px solid #ccc", fontSize: "1rem" }}
          />
        </div>

        {/* Email */}
        <div style={{ marginBottom: "1rem" }}>
          <label style={{ display: "block", marginBottom: "0.3rem", fontSize: "0.9rem" }}>Email</label>
          <input
            type="email"
            placeholder=""
            style={{ width: "100%", padding: "0.8rem", borderRadius: "6px", border: "1px solid #ccc", fontSize: "1rem" }}
          />
        </div>

        {/* Password */}
        <div style={{ marginBottom: "1rem" }}>
          <label style={{ display: "block", marginBottom: "0.3rem", fontSize: "0.9rem" }}>Password</label>
          <input
            type="password"
            placeholder=""
            style={{ width: "100%", padding: "0.8rem", borderRadius: "6px", border: "1px solid #ccc", fontSize: "1rem" }}
          />
        </div>

        {/* Confirm Password */}
        <div style={{ marginBottom: "1rem" }}>
          <label style={{ display: "block", marginBottom: "0.3rem", fontSize: "0.9rem" }}>Confirm Password</label>
          <input
            type="password"
            placeholder=""
            style={{ width: "100%", padding: "0.8rem", borderRadius: "6px", border: "1px solid #ccc", fontSize: "1rem" }}
          />
        </div>

        {/* Checkbox */}
        <div style={{ display: "flex", alignItems: "center", marginBottom: "1.5rem", fontSize: "0.9rem" }}>
          <input
            type="checkbox"
            checked={agreed}
            onChange={() => setAgreed(!agreed)}
            style={{ marginRight: "0.5rem" }}
          />
          <span>I agree, I am 18 and above</span>
        </div>

        {/* Create Account Button */}
        <button
          disabled={!agreed}
          style={{
            width: "100%",
            padding: "0.8rem",
            backgroundColor: "#000000", // black button
            color: "white",
            fontWeight: "bold",
            border: "none",
            borderRadius: "6px",
            cursor: agreed ? "pointer" : "not-allowed",
            marginBottom: "1rem"
          }}
        >
          Create Account
        </button>

        {/* Link back to Login */}
        <p style={{ fontSize: "0.9rem", color: "black", textAlign: "center" }}>
          Already have an account?{" "}
          <Link to="/" style={{ color: "#FF0000", textDecoration: "none" }}>Login</Link>
        </p>
      </div>
    </div>
  );
}

export default Register;
